}

/* Font: Med Emph */
#right-side .right-side-list li em, #right-side .right-side-list li p, .question .header .question_points_holder, #grades_summary th.title .context {
    color: var(--custom-text-emp-med-transparent);
}

/* Footer Logo */
#footer .footer-logo {
    filter: grayscale(100%);
}

/* Menu Button on Card Background */
.ic-DashboardCard__header-button {
    text-shadow: 0px 1px 5px black;
    border-radius: 15%;
}
.Button--icon-action, .Button--icon-action-rev {
	background: transparent;
    border: none;
    color: #fff;
}
.Button--icon-action-rev:hover {
    background-color: rgba(0,0,0,0.16);
    color: #fff;
    border: none;
}
.Button--icon-action-rev:focus {
    background-color: rgba(0,0,0,0.36);
    color: #fff;
    border: none;
    box-shadow: none;
}

/* Row */
.stream_header:hover {
    background-color: var(--custom-button-container-hover);
}
.stream-details tr:hover {
    background-color: transparent;
}
.close {
    color: var(--custom-text-emp-med-transparent);
    text-shadow: none;
    border-radius: 0.25em;
    padding: 0.25em;
}

#right-side .right-side-list {
