}

.ui-dialog .ui-dialog-titlebar-close span {
    filter: invert(1);
}

/* Link Color  */
a.fbyHH_bGBk, button.fbyHH_bGBk, a.fbyHH_bGBk:active, a.fbyHH_bGBk:hover, button.fbyHH_bGBk:active, button.fbyHH_bGBk:hover, .gcnt-list-link-wrapper a.gcnt-list-link:link, .gcnt-list-link-wrapper a.gcnt-list-link:visited, .gcnt-list-link-wrapper button.gcnt-list-link, a.fbyHH_bGBk:focus, button.fbyHH_bGBk:focus {
    color: var(--eHiXd-linkColor);
}
a.fbyHH_bGBk:focus, button.fbyHH_bGBk:focus {
    text-decoration: underline;
    outline-color: white;
}

.ui-dialog.ui-widget-content, .pill {
	box-shadow: none;
}

}

@-moz-document domain("canvadocs.instructure.com") {
:root {
	/* DPs */
    --custom-01-dp: #1e1e1e;
    --custom-04-dp: #272727;
    --custom-08-dp-transparent: rgba(255,255,255,0.12);
    /* Buttons */
    --custom-button-container-hover: rgba(255,255,255,0.04);
    --custom-button-container-focus: rgba(255,255,255,0.12);
    --custom-botton-border: rgba(255,255,255,0.29);
    --custom-botton-border-focus: rgba(255,255,255,1);
}


.Pages {
    background-color: var(--custom-01-dp);
}


.ViewerControls, .AnnotationControlButton-outer, .AnnotationControlButton {
    background-color: var(--custom-04-dp);
    border-color: var(--custom-04-dp);
}

.AnnotationControlButton, .AnnotationControlButton .AnnotationControlButton-outer {
    border-radius: 0.25em;
}


.AnnotationControlButton:hover:enabled {
    background-color: var(--custom-button-container-hover);
}
.AnnotationControlButton:hover:enabled .AnnotationControlButton-outer {
    background-color: transparent;
    border-color: var(--custom-botton-border);
}


.AnnotationControlButton:focus:enabled {
    background-color: var(--custom-button-container-focus);
    outline: none;
}
.AnnotationControlButton:focus:enabled .AnnotationControlButton-outer {
    background-color: transparent;
    border-color: var(--custom-botton-border-focus);
}

.Page-canvas-container {
    border-color: var(--custom-08-dp-transparent);
}

.Page-container{
    border-color: var(--custom-08-dp-transparent) !important;
}
}

